import React, {useEffect} from 'react';
import logo from './react.svg';
import './Home.css';
import Header from "./components/Header";
import Home_About from "./components/Home_About";
import Home_Projects from "./components/Home_Projects";
import Home_Service from "./components/Home_Service";
import Home_Contact from "./components/Home_Contact";
import NavBar from "./components/common/NavBar";
import Scrollbar from 'smooth-scrollbar';



const Home =() => {
    useEffect(() => {


        Scrollbar.init(document.querySelector('#my-scrollbar'), {
            damping: 0.1,
            renderByPixels: true,
            thumbMinSize: 20

        });

    }, [])
    return (
        <div id={"my-scrollbar"}>
            <div className="scroll-content">
                <NavBar/>
                <Header/>
                <Home_About/>
                <Home_Projects/>
                <Home_Service/>
                <Home_Contact/>
            </div>
            <div className="scrollbar-track scrollbar-track-x">
                <div className="scrollbar-thumb scrollbar-thumb-x"></div>
            </div>
            <div className="scrollbar-track scrollbar-track-y">
                <div className="scrollbar-thumb scrollbar-thumb-y"></div>
            </div>
        </div>
    );
}

export default Home;
